public class LogoBollettino {

    private static String LogoBolzanoBase64 = "";
     
    private static String logoAO = "";
 		  
    
	public LogoBollettino() {
		
	}
	
	public static String getLogoBolzano64() {
		return LogoBollettino.LogoBolzanoBase64;
	}
	
	public String getLogo(String cutecute) {
		switch(cutecute) {
			case "000P6": 
				return LogoBolzanoBase64;
			case "000P4":
				return logoAO;
			default:
			    return "";
		}
	}

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
	}

}
